  name: Project APIs
  description: >-
    # About this collection


    This collection guides you through the process of setting up an integration
    test to ensure that all individual components of an API function together
    seamlessly.


    The API under test in this collection includes three endpoints for
    registering and receiving a token, accessing your unique generated name, and
    unregistering a token:


    - POST `/api/auth/models/nameFile.obj`

    - POST `/api/auth/upload`

    - GET `/api/auth/setting`
        

    By setting up requests in the order of the operation, we can test the flow
    of data to and from the endpoints and ensure they work together as expected.
    We also verify that the data persists between requests on the back end.


    ## **Using this collection**


    **Step 1:** Check out the requests' documentation to learn more about -


    - what each request is meant to do.

    - the tests we've added against each one.
        

    **Step 2:** Run this collection by clicking on "Run".


